import {
  Container,
  Divider,
  Paper,
  Typography,
  Box,
  Grid,
  Card,
  CardMedia,
  TextField,
  Chip,
} from "@mui/material";
import React from "react";
import { styles } from "./styles";
import TagsInput from "./TagInput";
const AddPostPage = () => {
  const handleSelecetedTags = (items) => {
    console.log(items);
  };
  return (
    <Container sx={{ paddingTop: 5, paddingLeft: 2 }}>
      <Typography sx={{ fontSize: 20 }}>Add Post</Typography>
      <Paper elevation={3} sx={styles.container}>
        <Card sx={{ height: "100%", marginRight: 4 }}>
          <CardMedia
            height={300}
            component={"img"}
            sx={{
              backgroundColor: "rgba(0, 0, 0, 0.5)",
              backgroundBlendMode: "darken",
              width: "250px",
            }}
            image="/client/src/pages/AddPost/random.jpg"
            alt="random"
          />
        </Card>
        <Divider orientation="vertical" flexItem />
        <Grid container spacing={3} sx={{ marginLeft: 1 }}>
          <Grid item sm={6}>
            <TextField
              name="adventureName"
              label="Adventure Name"
              fullWidth
              variant="outlined"
              autoFocus
              type="text"
            />
          </Grid>
          <Grid item sm={6}>
            <TextField
              name="adventureTags"
              label="Tags"
              fullWidth
              variant="outlined"
              type="text"
            />
          </Grid>
          <Grid item sm={12}>
            <TextField
              name="adventureDetails"
              label="Adventure Details"
              fullWidth
              variant="outlined"
              type="text"
              multiline
              rows={4}
            />
          </Grid>
          <Grid item sm={6}></Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default AddPostPage;
